import Sculpture from "./Sculptures";
import Gallery from "./Gallery";
import Form from "./Form";
import Counter from "./Counter";
import Counter2 from "./Counter2";
import Counter3 from "./Counter3";
import Counter4 from "./Counter4";
import Increase from "./Increase";
import Message from "./Message";
import StaticDot from "./DotStatic";

import './state.css';
const props = { 
 show: { 
  sculpture: false,
  gallery: false,
  form: false,
  counter: false,
  counter2: false,
  counter3: false,
  counter4: false,
  increase: false,
  message: false,
  staticDot: true
 } 
};

const State = () => { 

 return (
   <div>
     {props.show.sculpture && <Sculpture />}
     {props.show.gallery && 
            <div className="Page">
            <Gallery />
            <Gallery />
          </div>

     }
     {props.show.form && <Form />}
     {props.show.counter && <Counter />}
     {props.show.counter2 && <Counter2 />}
     {props.show.counter3 && <Counter3 />}
     {props.show.counter4 && <Counter4 />}
     {props.show.increase && <Increase />}
     {props.show.message && <Message />}
     {props.show.staticDot && <StaticDot />}
   </div>
 );
};

export default State;
